const AdminSidebar = () => {
  return (
    <div style={{ width: '200px', background: '#eee', padding: '1rem' }}>
      <h3>Admin Menu</h3>
      <ul>
        <li>Manage Classes</li>
        <li>Manage Subjects</li>
        <li>Results</li>
        <li>Change Password</li>
      </ul>
    </div>
  );
};

export default AdminSidebar;
